
var images = [
	'data:image/jpeg;base64,',
	'data:image/jpeg;base64,',
	'data:image/jpeg;base64,',
	'data:image/jpeg;base64,',
	'data:image/jpeg;base64,',
	'data:image/jpeg;base64,'
];

function randomImg(){
	return images[Math.floor(Math.random()*images.length)];
}

const isPlural = w=>!!nlp(w).nouns().isPlural().out();

(function checkGoldblumStatus(){
	document.querySelectorAll('*').forEach(ele=>{
		if(ele.blumified) return;
		ele.blumified = true;
		if(ele.tagName === "IMG"){
			var w = ele.width;
			var h = ele.height;
			ele.src = randomImg();
			ele.width = w;
			ele.height = h;
		}else if(ele.tagName === "SVG"){
			var bBox = ele.getBBox();
			var w = bBox.width;
			var h = bBox.height
			var img = new Image();
			img.src = randomImg();
			img.width = w;
			img.height = h;
			ele.parentNode.replaceChild(img, ele);
		}
		if(ele.style.backgroundImage) ele.style.backgroundImage = "url("+randomImg()+")";
		if (~['P', 'H1', 'H2', 'H3', 'H4', 'H5', 'H6'].indexOf(ele.tagName)){
			var txt = ele.innerText;
			var nouns = [...new Set(nlp(txt).nouns().out('array').filter(w=>!~w.indexOf(' ')))];
			var html = ele.innerHTML;
			
			nouns.forEach(noun => {
				var replace = isPlural(noun) ? 'Jeff Goldblums' : 'Jeff Goldblum';
				try{ html = html.replace(new RegExp("\\b"+noun+"\\b", 'g'), replace); }catch(e){}
			});
			ele.innerHTML = html;
		}
	});
	setTimeout(checkGoldblumStatus, 1000);
})();